import React from 'react';
import ReacrDOM from "react-dom";
import add, {subtract, mul, div} from "./App"

ReacrDOM.render(
  <>
  {add}
  {subtract}
  {mul}
  {div}
  </>,
  document.getElementById('root')  
);
